import { useEffect, useState } from "react";

const ToDo = () => {
  const [data, setData] = useState();

  const fetchData = async() => {

    const response =await fetch("http://localhost:3000/getAll")
    const apiData = await response.json()
    setData(apiData)
    console.log("qwerty",apiData);
  }

  useEffect(() => {
    fetchData();
  },[])

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#181f38",
        width: "100%",
        height: "100vh",
      }}
    >
      <div
        style={{
          border: "2px solid",
          width: "600px",
          height: "400px",
          borderRadius: "20px",
          backgroundColor: "#25283c",
        }}
      >
        <div style={{ margin: "30px" }}>
          <h1 style={{ color: "#7b49b5" }}>TODO</h1>
          <input
            type="text"
            placeholder="Enter a todo..."
            style={{
              width: "-webkit-fill-available",
              height: "35px",
              border: "none",
              borderRadius: "10px",
              backgroundColor: "#3b3f51",
              color: "white",
              textIndent: "10px",
            }}
          />

          <button
            style={{
              width: "-webkit-fill-available",
              height: "35 px",
              border: "none",
              borderRadius: "10px",
              backgroundColor: "#531d94",
              marginTop: "20px",
              color: "white",
            }}
          >
            Add Todo
          </button>

          <div
            style={{
              width: "-webkit-fill-available",
              height: "40px",
              border: "none",
              borderRadius: "10px",
              backgroundColor: "#3b3f51",
              display: "flex",
              marginTop: "20px",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <div style={{ margin: "10px", color: "white" }}>Meditation</div>
            <button
              style={{
                margin: "10px",
                color: "white",
                backgroundColor: "#b82f4c",
                borderRadius: "10px",
                border: "none",
                padding: "6px 13px 6px 13px",
              }}
            >
              Delete
            </button>
          </div>

          <div style={{ marginTop: "20px" }}>
            <span style={{ color: "yellow", cursor: "pointer" }}>Sign Out</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ToDo;
